import React, { useState } from 'react';
import styled, { css } from 'styled-components';

const Navbar = styled.nav`
  position: fixed;
  top: 0;
  left: 0;
  height: 70px;
  width: 100%;
  background-color: gray;
  z-index: 100;
`;

const NavBarContainer = styled.div`
  position: relative;
  height: 100%;
  max-width: 1000px;
  width: 100%;
  background-color: gray;
  margin: 0 auto;
  padding: 0 30px;
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const SidebarOpen = styled.i`
  color: 
  font-size: 25px;
  padding: 5px;
  cursor: pointer;
`;

const Logo = styled.span`
  font-size: 25px;
  font-weight: 500;
  color: var(--text-color);
  text-decoration: none;

  a {
    color: inherit;
    text-decoration: none;
  }
`;

const Menu = styled.div`
  display: none;

  ${Navbar}:hover & {
    display: block;
  }
`;

const LogoToggle = styled.div`
  display: flex;
  align-items: center;
`;

const NavLinks = styled.ul`
  list-style: none;
  padding: 0;
  margin: 0;
  display: flex;
  align-items: center;

  li {
    margin: 0 10px;

    a {
      color: var(--text-color);
      text-decoration: none;

      &:hover {
        text-decoration: underline;
      }
    }
  }
`;

const DarkLightSearchBox = styled.div`
  display: flex;
  align-items: center;
`;

const DarkLight = styled.div`
  display: flex;
  align-items: center;

  .moon,
  .sun {
    font-size: 22px;
    cursor: pointer;
    margin-right: 5px;
    color: var(--text-color);
    opacity: 0;
    pointer-events: none;
    transition: all 0.3s ease;
  }

  ${Navbar}:hover & {
    .moon,
    .sun {
      opacity: 1;
      pointer-events: auto;
    }
  }
`;

const SearchToggle = styled.div`
  display: flex;
  align-items: center;
`;

const CancelIcon = styled.i`
  font-size: 22px;
  cursor: pointer;
  margin-right: 5px;
  color: var(--text-color);
  opacity: 0;
  pointer-events: none;
  transition: all 0.3s ease;
`;

const SearchBox = styled.div`
  position: relative;

  ${Navbar}:hover & {
    ${CancelIcon} {
      opacity: 1;
      pointer-events: auto;
    }
  }
`;

const SearchField = styled.div<any>
`
  position: absolute;
  bottom: -85px;
  right: 5px;
  height: 50px;
  width: 300px;
  display: flex;
  align-items: center;
  background-color: var(--nav-color);
  padding: 3px;
  border-radius: 6px;
  box-shadow: 0 5px 5px rgba(0, 0, 0, 0.1);
  opacity: 0;
  pointer-events: none;
  transition: all 0.3s ease;

  input {
    height: 100%;
    width: 100%;
    padding: 0 10px;
    outline: none;
    border: none;
    border-radius: 4px;
    font-size: 14px;
    font-weight: 400;
    color: var(--text-color);
    background-color: var(--nav-color);
  }

  ${props => props.active && css`
    bottom: -74px;
    opacity: 1;
    pointer-events: auto;
  `}
`;

const SearchIcon = styled.i`
  font-size: 22px;
  cursor: pointer;
  margin-left: 10px;
  color: var(--text-color);
`;

const NavbarComponent = () => {
  const [darkMode, setDarkMode] = useState(false);
  const [searchActive, setSearchActive] = useState(false);

  const handleDarkModeToggle = () => {
    setDarkMode(!darkMode);
  };

  const handleSearchToggle = () => {
    setSearchActive(!searchActive);
  };

  return (
    <Navbar>
      <NavBarContainer>
        <SidebarOpen className="bx bx-menu sidebarOpen" />
        <Logo>
          <a href="#">CodingLab</a>
        </Logo>
        <Menu>
          <LogoToggle>
            <Logo>
              <a href="#">CodingLab</a>
            </Logo>
            <i className="bx bx-x siderbarClose"></i>
          </LogoToggle>
          <NavLinks>
            <li><a href="#">Home</a></li>
            <li><a href="#">About</a></li>
            <li><a href="#">Portfolio</a></li>
            <li><a href="#">Services</a></li>
            <li><a href="#">Contact</a></li>
          </NavLinks>
        </Menu>
        <DarkLightSearchBox>
          <DarkLight>
            <i className={`bx bx-moon moon ${darkMode ? '' : 'active'}`} onClick={handleDarkModeToggle}></i>
            <i className={`bx bx-sun sun ${darkMode ? 'active' : ''}`} onClick={handleDarkModeToggle}></i>
          </DarkLight>
          <SearchBox>
            <SearchToggle>
              <CancelIcon className={`bx bx-x cancel ${searchActive ? 'active' : ''}`} onClick={handleSearchToggle} />
              <SearchIcon className={`bx bx-search search ${searchActive ? '' : 'active'}`} onClick={handleSearchToggle} />
            </SearchToggle>
            <SearchField active={searchActive}>
              <input type="text" placeholder="Search..." />
              <SearchIcon className="bx bx-search" />
            </SearchField>
          </SearchBox>
        </DarkLightSearchBox>
      </NavBarContainer>
    </Navbar>
  );
};

export default NavbarComponent;
